<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />

    <title>@storybook/cli - Storybook</title>

    <link rel="shortcut icon" href="./favicon.ico" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />

      

    <style>
      #storybook-root[hidden]{
        display: none !important;
      }
    </style>

    
  </head>
  <body>
    <div id="root"></div>

    
    <script>
      
        
          window['FEATURES'] = {
  "postcss": true,
  "warnOnLegacyHierarchySeparator": true,
  "buildStoriesJson": false,
  "storyStoreV7": true,
  "breakingChangesV7": true,
  "interactionsDebugger": false,
  "babelModeV7": true,
  "argTypeTargetsV7": true,
  "emotionAlias": false
};
        
      
        
          window['REFS'] = {
  "@chakra-ui/react": {
    "id": "@chakra-ui/react",
    "url": "https://storybook.chakra-ui.com",
    "title": "Chakra UI",
    "version": "2.3.6",
    "type": "server-checked"
  }
};
        
      
        
          window['LOGLEVEL'] = "info";
        
      
        
          window['DOCS_OPTIONS'] = {
  "enabled": true,
  "defaultName": "Docs",
  "docsPage": true
};
        
      
        
      
        
      
        
      
        
      
    </script>
    

    <script src="./sb-manager/runtime.mjs" type="module"></script>

    
    <script src="./sb-addons/node_modules/%40storybook/addon-actions/manager.mjs" type="module"></script>
    
    <script src="./sb-addons/node_modules/%40storybook/addon-links/manager.mjs" type="module"></script>
    
    <script src="./sb-addons/node_modules/storybook-addon-react-docgen/register.mjs" type="module"></script>
    
    <script src="./sb-addons/node_modules/%40chakra-ui/storybook-addon/dist/preset/register.cjs.mjs" type="module"></script>
    
    <script src="./sb-addons/.storybook/manager.mjs" type="module"></script>
    
  </body>
</html>
